import styled from "styled-components/native"

export const FirstView3 = styled.View`
flex-direction: row;
align-items: center;
display: flex;
`;

export const BigText3 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 24px;
line-height: 28px;
text-align: center;
color: #C3AD60;
`;
